function traducir( palabra ) {
	console.log( `Palabra 1 => ${palabra}` );
	palabra = palabra.replaceAll( "car" , "auto" );
	palabra = palabra.replaceAll( "Tuesday" , "Martezzz" );
	console.log( `Palabra 2 => ${palabra}` );
	return palabra;
};

export { traducir }
